import React from 'react';
import './App.css';

import Navigation from './components/Main/navigation/Navigation'

import Contents from './components/Main/contents/Contents'

import { useState } from 'react';

function App(props) {
  var Check;
  if(Check === undefined) {
    const [state, setState] = useState("-1");
    Check = 1;
  }

  console.log("Start App");
  var onClickNav = (iNum) => {
    setState(iNum);
  }

  return (
    <div className="App">
      <Navigation onClickNav = {onClickNav}/>
      {state === 'HOME' ? <Contents /> : <div>State Error! { state }</div> }

      {/* <Contents /> */}

      <div id="bottom">
        make with React_Node.js
        GaeTaeng's Home <br />
        Naver : 000000@naver.com <br />
        GMail : 000000@gmail.com <br />
      </div>

    </div>
  );
}

export default App;
